package model;

public class StavkaPrometnogDokumenta {
	Integer id;
	Integer rbr;
	Integer kolicina;
	Double cena;
	Double vrednost;
	Integer artikalID;
	Integer prometniDokID;
	public StavkaPrometnogDokumenta() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Integer getId() {
		return id;
	}
	public void setId(Integer id) {
		this.id = id;
	}
	public Integer getRbr() {
		return rbr;
	}
	public void setRbr(Integer rbr) {
		this.rbr = rbr;
	}
	public Integer getKolicina() {
		return kolicina;
	}
	public void setKolicina(Integer kolicina) {
		this.kolicina = kolicina;
	}
	public Double getCena() {
		return cena;
	}
	public void setCena(Double cena) {
		this.cena = cena;
	}
	public Double getVrednost() {
		return vrednost;
	}
	public void setVrednost(Double vrednost) {
		this.vrednost = vrednost;
	}
	public Integer getArtikalID() {
		return artikalID;
	}
	public void setArtikalID(Integer artikalID) {
		this.artikalID = artikalID;
	}
	public Integer getPrometniDokID() {
		return prometniDokID;
	}
	public void setPrometniDokID(Integer prometniDokID) {
		this.prometniDokID = prometniDokID;
	}
	

}
